    PresaleToken public token;
    address public tokenOwner;
    bool public tokenAvailableForSale = false;
    address[] public contributorsList;

    constructor(PresaleToken _presaleToken, address _owner) {
        token = _presaleToken;
        tokenOwner = _owner;
    }

